import {Stage} from "@react-three/drei";

export default function Cube() {
    return (
        <Stage environment="city" intensity={0.6}>
            <mesh rotation={[.3,.5,0]}>
                <boxGeometry args={[1.3,1.3,1.3]}/>
                <meshStandardMaterial color={"#e76666"}/>
            </mesh>
        </Stage>
    )
}
